  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Medicare Improvements for Patients
  and Providers Act (MIPPA) of 2008 requires that CMS and facilities inform beneficiaries
  about facility performance under the End-Stage Renal Disease (ESRD) Quality Incentive
  Program (QIP), and it also requires that CMS furnishes each dialysis facility with
  a Performance Score Certificate (PSC) that documents the facilitys Total Performance
  Score. The Payment Year (PY) 2017 NPRM Public Use Data File contains facility-level
  data used to calculate the benchmarks, performance standards, and achievement thresholds
  included in the PY 2017 NPRM. The PY 2017 Final Rule Public Use Data File contains
  facility-level data used to calculate the benchmarks, performance standards, and
  achievement thresholds included in the PY 2017 - PY 2018 Final Rule. The PY 2016
  NPRM Public Use Data File contains facility-level data used to calculate the benchmarks,
  performance standards, and achievement thresholds included in the PY 2016 NPRM.
  The PY 2016 Final Rule Public Use Data File contains facility-level data used to
  calculate the benchmarks, performance standards, and achievement thresholds included
  in the PY 2016 Final Rule.  Facility identifiers have been removed.</p>n\",\n\t\"license_title\":
